import { transferList, serviceTransfer } from '@/api/kefu';
export default {
  name: "transfer",
  props: {
    userUid: {
      type: String | Number,
      default: ''
    }
  },
  data: function data() {
    return {
      loading: false,
      currentChoose: '',
      labelLists: [],
      name: ''
    };
  },
  mounted: function mounted() {
    this.getList();
  },
  methods: {
    getList: function getList() {
      var _this = this;

      transferList({
        nickname: this.name,
        uid: this.userUid
      }).then(function (res) {
        _this.labelLists = res.data.list;
      });
    },
    bindActive: function bindActive(item) {
      var _this2 = this;

      // this.$emit('transferPeople',item)
      if (this.userUid == "") {
        return this.$Message.error('转接失败');
      }

      serviceTransfer({
        uid: this.userUid,
        kefuToUid: item.uid
      }).then(function (res) {
        _this2.$Message.success(res.msg);

        _this2.$emit('close');
      }).catch(function (error) {
        _this2.$Message.error(error.msg);
      });
    }
  }
};
